    {
      "lineNumber": 129621,
      "originalJapaneseLine": "「モンスターはお前らの方だろうが！」",
      "translatedEnglishLine": "\"You guys are the monsters!\""
    },
    {
      "lineNumber": 129622,
      "originalJapaneseLine": "「お、おい、誰か魔物使いを連れてこい！",
      "translatedEnglishLine": "\"H-hey, someone bring a beast tamer!\""
    },
    {
      "lineNumber": 129623,
      "originalJapaneseLine": "　それと警備隊もだ、早くしろ！」",
      "translatedEnglishLine": "And the security squad too, hurry up!\""
    },
    {
      "lineNumber": 129624,
      "originalJapaneseLine": "「ランス様、どうやらここでは",
      "translatedEnglishLine": "\"Lord Rance, it seems that here"
    },
    {
      "lineNumber": 129625,
      "originalJapaneseLine": "　私達の方がモンスターのようですよ！？",
      "translatedEnglishLine": "we are the monsters!?\""
    },
    {
      "lineNumber": 129626,
      "originalJapaneseLine": "　に、逃げないとまずいような……」",
      "translatedEnglishLine": "\"I- it looks like we need to run away...\""
    },
    {
      "lineNumber": 129627,
      "originalJapaneseLine": "「知ったことか、",
      "translatedEnglishLine": "\"Who cares,"
    },
    {
      "lineNumber": 129628,
      "originalJapaneseLine": "　こいつらにモンスターとしての",
      "translatedEnglishLine": "I'll remind these guys of their position"
    },
    {
      "lineNumber": 129629,
      "originalJapaneseLine": "　立場を思い出させてやる！」",
      "translatedEnglishLine": "as monsters!\""
    },
    {
      "lineNumber": 129630,
      "originalJapaneseLine": "「どりゃーーー！　経験値になれーーーッ！」",
      "translatedEnglishLine": "\"Take this---! Become experience points---!\""
    },
    {
      "lineNumber": 129631,
      "originalJapaneseLine": "「待ーーーーーった！",
      "translatedEnglishLine": "\"Waiiiiit!\""
    },
    {
      "lineNumber": 129632,
      "originalJapaneseLine": "　ストップ！　ストーーップ！」",
      "translatedEnglishLine": "\"Stop! Stooop!\""
    },
    {
      "lineNumber": 129633,
      "originalJapaneseLine": "「む、なんだイカマン。",
      "translatedEnglishLine": "\"Hmph, what's this, Ikaman."
    },
    {
      "lineNumber": 129634,
      "originalJapaneseLine": "　邪魔立てするなら丁度いい、まずはお前から……」",
      "translatedEnglishLine": "If you're going to interfere, then perfect, I'll start with you...\""
    },
    {
      "lineNumber": 129635,
      "originalJapaneseLine": "「うわっ、ホントにランスだよ。",
      "translatedEnglishLine": "\"Whoa, it's really Rance."
    },
    {
      "lineNumber": 129636,
      "originalJapaneseLine": "　なんでこの時代に……」",
      "translatedEnglishLine": "Why in this era...\""
    },
    {
      "lineNumber": 129637,
      "originalJapaneseLine": "「は？　どうして俺の名を……」",
      "translatedEnglishLine": "\"Huh? How do you know my name...\""
    },
    {
      "lineNumber": 129638,
      "originalJapaneseLine": "「ああ、そうか、この姿じゃ分からないか。",
      "translatedEnglishLine": "\"Ah, I see, you can't tell from this form."
    },
    {
      "lineNumber": 129639,
      "originalJapaneseLine": "　あたしも前は人類に近い姿だったからね」",
      "translatedEnglishLine": "I also used to have a form closer to humans.\""
    },
    {
      "lineNumber": 129640,
      "originalJapaneseLine": "「んん？　このはすっぱな口調……",
      "translatedEnglishLine": "\"Hmm? This curt tone..."
    },
    {
      "lineNumber": 129641,
      "originalJapaneseLine": "　どこかで聞き覚えが……」",
      "translatedEnglishLine": "Sounds familiar from somewhere...\""
    },
    {
      "lineNumber": 129642,
      "originalJapaneseLine": "「ハンティさん！",
      "translatedEnglishLine": "\"Hanti-san!"
    },
    {
      "lineNumber": 129643,
      "originalJapaneseLine": "　このモンスターと知り合いなんですか！？",
      "translatedEnglishLine": "Are you acquainted with this monster!?\""
    },
    {
      "lineNumber": 129644,
      "originalJapaneseLine": "「は」",
      "translatedEnglishLine": "\"Yes.\""
    },
    {
      "lineNumber": 129645,
      "originalJapaneseLine": "「ハンティーーーっ！？",
      "translatedEnglishLine": "\"Hanti---!?"
    },
    {
      "lineNumber": 129646,
      "originalJapaneseLine": "　お前もしや、パットンと一緒にいた",
      "translatedEnglishLine": "You might be the black-haired Kalla who was with Patton!"
    },
    {
      "lineNumber": 129647,
      "originalJapaneseLine": "　黒髪のカラーか！？」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 129648,
      "originalJapaneseLine": "「お、よく覚えていたね」",
      "translatedEnglishLine": "\"Oh, you remembered well.\""
    },
    {
      "lineNumber": 129649,
      "originalJapaneseLine": "「そうさ、孤高の黒髪カラーこと、",
      "translatedEnglishLine": "\"That's right, the solitary black-haired Kalla,"
    },
    {
      "lineNumber": 129650,
      "originalJapaneseLine": "　ハンティ・カラーだよ」",
      "translatedEnglishLine": "Hanti Kalla.\""
    },
    {
      "lineNumber": 129651,
      "originalJapaneseLine": "「……見ての通り、今は髪ないけどね」",
      "translatedEnglishLine": "\"...As you can see, I don't have hair now though.\""
    },
    {
      "lineNumber": 129652,
      "originalJapaneseLine": "ハンティはうにゃうにゃと触腕を動かした。",
      "translatedEnglishLine": "Hanti wriggled her tentacles."
    },
    {
      "lineNumber": 129653,
      "originalJapaneseLine": "「……なんで、んな軟体の体に」",
      "translatedEnglishLine": "\"...Why such a soft-bodied form?\""
    },
    {
      "lineNumber": 129654,
      "originalJapaneseLine": "「……それはあたしが聞きたいね」",
      "translatedEnglishLine": "\"...That's what I want to know.\""
    },
    {
      "lineNumber": 129655,
      "originalJapaneseLine": "「突然全てのカラーが苦しみながら溶けたと思ったら",
      "translatedEnglishLine": "\"Suddenly, all Kallas started melting in agony,"
    },
    {
      "lineNumber": 129656,
      "originalJapaneseLine": "　あたしだけ何故かこの姿になってたんだ」",
      "translatedEnglishLine": "but for some reason, only I ended up like this.\""
    },
    {
      "lineNumber": 129657,
      "originalJapaneseLine": "「ふん、神様ってのは黒髪カラーが",
      "translatedEnglishLine": "\"Hmph, it seems the gods have a special fondness"
    },
    {
      "lineNumber": 129658,
      "originalJapaneseLine": "　よっぽどお気に入りのようだ」",
      "translatedEnglishLine": "for black-haired Kallas.\""
    },
    {
      "lineNumber": 129659,
      "originalJapaneseLine": "「何を言ってるかよく分からんが……」",
      "translatedEnglishLine": "\"I don't really understand what you're saying, but...\""
    },
    {
      "lineNumber": 129660,
      "originalJapaneseLine": "「待て、カラーが全員溶けただと……",
      "translatedEnglishLine": "\"Wait, all the Kallas melted...?\""
    },
    {
      "lineNumber": 129661,
      "originalJapaneseLine": "　パステル達もか？　人はどこにいる？",
      "translatedEnglishLine": "Pastels too? Where are the humans?"
    },
    {
      "lineNumber": 129662,
      "originalJapaneseLine": "　そもそも、ここは一体どこなのだ」",
      "translatedEnglishLine": "In the first place, where exactly is this place?\""
    },
    {
      "lineNumber": 129663,
      "originalJapaneseLine": "「ちょ、待った待った。",
      "translatedEnglishLine": "\"W-wait, wait."
    },
    {
      "lineNumber": 129664,
      "originalJapaneseLine": "　質問なら一個ずつにしてよ」",
      "translatedEnglishLine": "If you're going to ask questions, make them one at a time.\""
    },
    {
      "lineNumber": 129665,
      "originalJapaneseLine": "「パステル達なら……",
      "translatedEnglishLine": "\"As for the Pastels..."
    },
    {
      "lineNumber": 129666,
      "originalJapaneseLine": "　というより、あんたの知っている人達は",
      "translatedEnglishLine": "or rather, the people you know"
    },
    {
      "lineNumber": 129667,
      "originalJapaneseLine": "　戦いや寿命でずーーーっと大昔に死んだよ」",
      "translatedEnglishLine": "have been dead for a very long time, either from battle or old age.\""
    },
    {
      "lineNumber": 129668,
      "originalJapaneseLine": "「人が見当たらないのは、大量に現れた",
      "translatedEnglishLine": "\"The reason there are no people around is because a huge number of"
    },
    {
      "lineNumber": 129669,
      "originalJapaneseLine": "　エンジェルナイトに絶滅寸前にまで",
      "translatedEnglishLine": "Angel Knights appeared and reduced our numbers to the brink of extinction."
    },
    {
      "lineNumber": 129670,
      "originalJapaneseLine": "　数を減らされたから」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 129671,
      "originalJapaneseLine": "「ここがどこかってことだけど……",
      "translatedEnglishLine": "\"As for where this place is..."
    },
    {
      "lineNumber": 129672,
      "originalJapaneseLine": "　あんたも知っている通り、",
      "translatedEnglishLine": "As you also know,"
    },
    {
      "lineNumber": 129673,
      "originalJapaneseLine": "　ヘルマン国の首都、ラング・バウだよ」",
      "translatedEnglishLine": "this is Lang Bau, the capital of the Helman Kingdom.\""
    },
    {
      "lineNumber": 129674,
      "originalJapaneseLine": "「ただし――",
      "translatedEnglishLine": "\"However--"
    },
    {
      "lineNumber": 129675,
      "originalJapaneseLine": "五万年後のね」",
      "translatedEnglishLine": "50,000 years in the future.\""
    },
    {
      "lineNumber": 129676,
      "originalJapaneseLine": "「五万年ーーー！？」",
      "translatedEnglishLine": "\"50,000 years---!?\""
    },
    {
      "lineNumber": 129677,
      "originalJapaneseLine": "「わ、私達……そんな長い時間、",
      "translatedEnglishLine": "\"W-we... have been sleeping in a device for such a long time...?"
    },
    {
      "lineNumber": 129678,
      "originalJapaneseLine": "　装置で寝てたっていうことなんでしょうか……」",
      "translatedEnglishLine": "\""
    },
    {
      "lineNumber": 129679,
      "originalJapaneseLine": "「ま、待て待て待て！」",
      "translatedEnglishLine": "\"W-wait, wait, wait!\""
    },
    {
      "lineNumber": 129680,
      "originalJapaneseLine": "「それじゃあ、ホーネット様や……",
      "translatedEnglishLine": "\"So then, Lady Hornet and...\""
    }
  ]
